import { MakerNav } from "../../component/Navbar/homeNav"
import './Myprinters.css';
import Web3 from "web3";
import { useNavigate } from "react-router-dom";
import { useEffect,useState} from "react";
import OnBoarding from "../../SmartContracts/OnBoarding/OnBoarding";

export default function MyPrinters(){

    //const navigate=useNavigate();
    const [printerList,setPr]=useState('');
    const navigate=useNavigate();
    let result='';


    const removePrinter=(async(index)=>{
        const onboard=new OnBoarding();
        let res=await onboard.removePrinter(index);
        if(res!=='Error')
            window.location.reload();
    })

    useEffect(()=>{

        async function getPrintersData(){
            const boarding=new OnBoarding();
            const web3=new Web3();
            let res =await boarding.getPrinters();
            console.log(res)
            console.log("qui")
            result=res.map((value,key)=>{
                    return <tr key={key} className="printers" >
                        <td key={value.name+"name"} className="color" onClick={()=>navigate('/myprinters/'+web3.utils.toUtf8(value.name)+'&&'+key)}> {web3.utils.toUtf8(value.name)} </td>
                        <td key={value.volume+"volume"}  style={{width:"10px"}} onClick={()=>navigate('/myprinters/'+web3.utils.toUtf8(value.name)+'&&'+key)}>{value.volume}m<sup>3</sup></td>
                        <td key={value.maxPrintTemperature}  style={{width:"10px"}} onClick={()=>navigate('/myprinters/'+web3.utils.toUtf8(value.name)+'&&'+key)}>  {value.maxPrintTemperature}&#8451; </td>
                        <td key={key+"button"} style={{width:"10px"}}><button className="remove" onClick={()=>removePrinter(key)}>Rimuovi</button></td>
                    </tr>  
            })
            setPr(result);


        };
        getPrintersData();
        },[result])

    return(
        <div>
             <MakerNav/>
            <div className="printerTable">
            <h1>My printers</h1>


            <table className="myPrinters">
                <tbody>
                    <tr>
                        <th>Name</th>
                        <th>Volume</th>
                        <th>Max printer temperature</th>
                        <th>Remove</th>
                    </tr>
                    {printerList} 
                </tbody>

            </table>
            <div className="buttonArea">
                    <button className="AddprinterButton" onClick={()=>navigate('/addprinter')}>Aggiungi</button>
                </div>

            </div>

        </div>
    )
}








